import React from 'react';

import { NavLink } from 'react-router-dom';
import '../../css/navigation.css';

function toggleNav() {
  let navLeft = document.getElementById("navbar").style.left;
  document.getElementById("navbar").style.left = (navLeft === "0px") ? "-170.5px" : "0px";
  let navSymbol = document.getElementById("navbarOpenClose").innerHTML;
  document.getElementById("navbarOpenClose").innerHTML = (navSymbol === "☰") ? "╳" : "☰";
}

const Navigation = () => {
  return (
    <div id="navbar" className="navbar">
      <NavLink to="/" className="button noselect navbarButton">Home</NavLink>
      <NavLink to="/about" className="button noselect navbarButton">About</NavLink>
      <NavLink to="/contact" className="button noselect navbarButton">Contact</NavLink>
      <NavLink to="/designer" className="button noselect navbarButton">Designer</NavLink>
      <NavLink to="/play" className="button noselect navbarButton">Play Online</NavLink>
      <a id="navbarOpenClose" onClick={toggleNav} className="navbarOpenClose">&#9776;</a>
    </div>
  );
}

export default Navigation;
